function findBennysContentsRow(id, vehicleHash, category)
    if not SH_BENNYS[vehicleHash] then return end
    if bennys_cache[vehicleHash] and bennys_cache[vehicleHash][category] and bennys_cache[vehicleHash][category][id] then
        return bennys_cache[vehicleHash][category][id]
    end
    for i, v in pairs(SH_BENNYS[vehicleHash]) do
        if v.category == category then
            for c, ev in pairs(SH_BENNYS[vehicleHash][i].contents) do
                if ev.id == id then
                    if not bennys_cache[vehicleHash] then bennys_cache[vehicleHash] = {} end
                    if not bennys_cache[vehicleHash][category] then bennys_cache[vehicleHash][category] = {} end
                    if not bennys_cache[vehicleHash][category][id] then bennys_cache[vehicleHash][category][id] = {} end

                    bennys_cache[vehicleHash][category][id] = SH_BENNYS[vehicleHash][i].contents[c]
                    return SH_BENNYS[vehicleHash][i].contents[c]
                end
            end
        end
    end
    return false
end

function findBennysCategory(hash, id)
    if not SH_BENNYS[tonumber(hash)] then return end
    for i, v in pairs(SH_BENNYS[tonumber(hash)]) do
        for c, ev in pairs(SH_BENNYS[tonumber(hash)][i].contents) do
            if ev.id == tonumber(id) then
                return v.category
            end
        end
    end
    return false
end

exports("findBennysContentsRow", findBennysContentsRow)
exports("findBennysCategory", findBennysCategory)
